import React from "react";
import './bodyAboutMe.css';


class bodyAboutMe extends React.Component {
    render() {
        return (
            <div className={this.props.className}>
                <div className="container-splitter">
                    
                    <h1>About Me</h1>
                    <p>{this.props.AboutMeDescription}</p>
                </div>
            </div>
        )


    }

}
 export default bodyAboutMe;
